import React, { Component } from 'react'
import "./Home.css"
export class Home extends Component {
    render() {
        return (
            <div className='mainboard'>
                <div className='bg'>
                    <img style={{ height: "100%", }} src={require("../../assets/images/carousel/banner_9.jpg")} alt="carousel item" className="img-fluid" />
                </div>

            </div>
        )
    }
}

export default Home
